import React, { useState } from 'react'

import { FeedCol } from '../Footer/FooterElements'
import { FeatureHeader, FeatureRow } from '../MainSection/FeaturesElements'
import { FeedForm, FormSection, Input, Select, FormHeader, Label } from './DuckFormElements'




function DuckForm() {
    const [displaytext, setDisplayTest] = useState(false)
    // const[formData,setFormData]=useState({''})

    const handleClick = (val) => {
        console.log('Entry')
        let check = val.target.value;
        if (check == 'others') {
            setDisplayTest(true);
            console.log('called')
        }
        else {
            setDisplayTest(false);
        }
    }
    // {
    //     "nickname" : "asis",
    //     "time" : "15:25:44",
    //     "place" : "Montreal",
    //     "country" : "India",
    //     "food" : "Pepsi",
    //     "foodDescription": "Tastes like Coke",
    //     "foodType" : "Soft drink",
    //     "duckCount" : 22,
    //     "feedAmount" : 99
    // }
    const handleSubmit = async (e) => {
        e.preventDefault();  
        console.log('Entered');      
        alert('Thanks for Submitting');
        console.log(e.target);
        const data = new FormData(e.target);
        var body={};
        for (var [key, value] of data.entries()) { 
            // console.log(key, value);
            if(key!='food_type_text'){
                body[key] = value;
            }
        }
        if(body['foodType']=='others'){
            if(body['food_type_text'].trim.length!=0){
                body['foodType']=body['food_type_text'];
            }
        }
        console.log(body);





        // const response = await fetch('http://localhost:8080/survey/participate', {
        //   method: 'POST',
        //   headers: {
        //     'Content-Type': 'application/json',
        //   },
        //   body: JSON.stringify({ post: this.state.post }),
        // });
        // const body = await response.text();

        // this.setState({ responseToPost: body });
      };

    return (
        <>
            <FormSection id='survey'>
                <FeatureRow>
                    <FormHeader>
                        I welcome sharing your knowledge on ducks
                        </FormHeader>
                </FeatureRow>
                <FeatureRow>
                    <FeedForm method='post' action='#' onSubmit={handleSubmit}>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='name' isDisplay={true}>Nick Name</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="text" name="nickname" id="nickname" isDisplay={true} placeholder="Your Nick name" required />
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='park' isDisplay={true}>Place Name</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="text" name="park" id="place" isDisplay={true} placeholder="Place Name" required />
                            </FeedCol>

                        </FeatureRow>


                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='food' isDisplay={true}>Food</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="text" name="food" id="food" isDisplay={true} placeholder="What food?" required />
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='foodtype' isDisplay={true}>Food Type</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Select name="foodtype" id="foodType" onChange={handleClick}>
                                    <option value="friends" selected>Grain</option>
                                    <option value="search">Fish</option>
                                    <option value="ad"> Plants</option>
                                    <option value="Worms">Worms</option>
                                    <option value="others">others</option>
                                </Select>
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='food_type' isDisplay={displaytext}>Enter Food Type</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="text" name="food_type_text" isDisplay={displaytext} id="food_type_text" value='' placeholder="Enter Food Type" />
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='food' isDisplay={true}>Food Description</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="text" name="food" id="foodDescription" isDisplay={true} placeholder="Description of Food?" value=""/>
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='time' isDisplay={true}>Time for feeding</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="time" name="time" id="time" isDisplay={true} required />
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='duck_count' isDisplay={true}>Duck Count</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="text" name="duckCount" id="duckCount" isDisplay={true} placeholder="How Many Ducks are feed?" required />
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label for='quantity' isDisplay={true}>Quantity</Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="text" name="feedAmount" id="feedAmount" isDisplay={true} placeholder="Quantity Feed?" required />
                            </FeedCol>

                        </FeatureRow>
                        <FeatureRow>
                            <FeedCol isValue={false}>
                                <Label></Label>

                            </FeedCol>
                            <FeedCol isValue={true}>
                                <Input type="submit" isDisplay={true} value='Submit' />
                            </FeedCol>

                        </FeatureRow>


                    </FeedForm>
                </FeatureRow>
            </FormSection>

        </>
    )
}

export default DuckForm
